import {
  Link,
  Routes,
  Route,
  useNavigate,
} from 'react-router-dom';

function RecetaEnParticular(props) {

  const navigate = useNavigate();

    let data = props.datos
    
    return ( 
        <div>
          
      {
      Object.keys(data).map((key, index) => {
        if(key==="_id" || key==="__v"){
          return(
            <span></span>
          )
        }else{ return (
          <div key={index}>
            <h2>
              {key}: {data[key]}
            </h2>

          
          </div>
        );}
       
      })}

     <button style={props.verBoton} onClick={() => navigate(-1)}>volver a recetas</button>
           
        </div>
     );
}

export default RecetaEnParticular;
